import React, { Component } from 'react'
import { Route, Routes } from 'react-router-dom'
import { ShowStaffs } from './staffActions'

export default class Staffs extends Component {
  render() {
    return (
      <Routes>
        <Route exact path="/" element={<ShowStaffs adminList={adminList}/>} />
        <Route path="/edit/" element={<EditAdmin/>} />
        <Route path="/delete/" element={<DeleteAdmin/>} />
        <Route path="/new/" element={<NewAdmin/>} />


      </Routes>
    )
  }
}
